// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;

contract Migrations {
  address public owner;

  bytes32[] public tt;

  constructor() public {
    owner = msg.sender;
  }

  function setTt(bytes32 _a) public {
      tt.push(_a);
  }

  function getTt(uint256[] memory _ab) pure public returns(uint256){
      return _ab[0];
  }
}
